const cookieBox = document.querySelector(".wrapper-sm1"),
    acceptBtn = cookieBox.querySelector(".button-sm1");

//const cookieBoxOpen = document.querySelector(".blob-sm1"),
//     acceptBtnOpen = cookieBoxOpen.querySelector(".blob-sm1-img");

acceptBtn.onclick = ()=>{
    //setting cookie for 1 month, after one month it'll be expired automatically
    document.cookie = "LayCookie=hidden; max-age="+60*60*24*30;
    if(document.cookie){ //if cookie is set
        cookieBox.classList.add("hide"); //hide cookie box
        //cookieBoxOpen.classList.remove("hide")

    }else{ //if cookie not set then alert an error
        alert("Cookie can't be set! Please unblock this site from the cookie setting of your browser.");
    }
}


